from pulp import *
from time import time


def convertir_tiempo(tiempo):
    segundos = tiempo
    minutos = segundos // 60
    segundos = tiempo - minutos * 60
    horas = minutos // 60
    minutos = minutos - horas * 60
    msj = ''
    if horas > 0:
        msj += 'Horas: {} '.format(horas)
    if minutos > 0:
        msj += 'Minutos: {} '.format(minutos)
    msj += 'Segundos: {0:.2f}'.format(segundos)
    return msj

